import axios from "axios";

function Show({ data }) {
  return <p>{"data"}</p>;
}

Show.getInitialProps = async (context) => {
  const { id } = context.query;
  const res = await axios.get("https://api.tvmaze.com/search/shows?q=sherlock");
  const data = await res.data;
  console.log(data[0]);
  return {
    data: data,
  };
};

export default Show;
